import React, { Component } from 'react'
import Navbar from "../components/Navbar"
import Container from "../components/HomeContainer"
import EmailForm from "../components/Email"
import Footer from "../components/Footer"
import HomeContainer from '../components/HomeContainer'

class Home extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email: false,
            whichComponentToShow: 'Home'
        }
    }
    components = {
        "AddPlayer": <AddPlayer />,
        "ShowPlayers": <Players />,
        "Something1": <Something1 />,
        "Something2": <Something2 />
    }
    emailForm = () => {
        this.setState({
            whichComponentToShow: "Email",
            email: true
        })
    }
    homeContents = () => {
        this.setState({
            whichComponentToShow: "Home"
        })

    }

    whatToRender = (props) => {
        console.log("these are the props",props)
        if (props === 'Home') {
            return (
                <div>
                <HomeContainer />
            </div>
            )
        } else if (props === 'Email') {
            return (
                <div>
                <EmailForm />
            </div>
            )
        } else if (this.state.whichComponentToShow === 'Machine') {
            return (

                <div>
                <Container />
            </div>
            )
        }
    }
    renderComponent(props){
        console.log("hi",props)
        switch(props) {
        case "Home":
          return <HomeContainer />
        case "Email":
          return <EmailForm />
      }
    }



    render() {
        return (
            <div>
                <Navbar changeComponent={this.renderComponent} whatToshow={this.state.whichComponentToShow} emailForm={this.emailForm} homeContents={this.homeContents}>
                </Navbar >

                {/* {(this.state.email) ? <Container /> : <EmailForm />} */}
                <div>
            {components[this.state.renderComponent]}
        </div>



                <Footer>
                </Footer>
            </div>
        )
    }
}
export default Home;
